struct ListNode {
	int val;
	ListNode *next;
	ListNode(int x) : val(x), next(NULL) {}
};

void Output(ListNode* head, ListNode *end = NULL){
	ListNode *tmp = head;
	while (tmp != end){
		cout << tmp->val << " ";
		tmp = tmp->next;
	}
	cout << endl;
}

class Solution {
public:
	void swap(ListNode *l1, ListNode *l2){
		int tmp = l1->val;
		l1->val = l2->val;
		l2->val = tmp;
	}
	void quickSort(ListNode *head, ListNode *end){
		if (head != NULL&&end != NULL&&head->next != end){
			ListNode *tmp2 = NULL;
			ListNode *tmp = head;
			while (tmp != end){
				if (tmp->val < end->val){
					tmp2 = (tmp2 == NULL ? head : tmp2->next);
					swap(tmp2, tmp);
				}
				tmp = tmp->next;
			}
			ListNode* newEnd = tmp2;
			tmp2 = tmp2 == NULL ? head : tmp2->next;
			if (tmp2 != end){
				swap(tmp2, end);
				quickSort(tmp2->next, end);
			}
			quickSort(head, newEnd);
		}
	}
	ListNode *sortList2(ListNode *head) {
		if (head != NULL){
			ListNode *tmp = head;
			ListNode *end = NULL;
			while (tmp != NULL){
				end = tmp;
				tmp = tmp->next;
			}
			quickSort(head, end);
			return head;
		}
	}
	ListNode *merge(ListNode *leftHalf, ListNode *rightHalf){
		ListNode *tmp = new ListNode(0);
		ListNode *p = tmp;
		while (leftHalf != NULL&&rightHalf != NULL){
			if (leftHalf->val <= rightHalf->val){
				p->next = leftHalf;
				leftHalf = leftHalf->next;
			}
			else{
				p->next = rightHalf;
				rightHalf = rightHalf->next;
			}
			p = p->next;
		}
		if (leftHalf == NULL){
			p->next = rightHalf;
		}
		else{
			p->next = leftHalf;
		}
		p = tmp->next;
		delete tmp;
		return p;
	}
	ListNode *mergeSort(ListNode *head, ListNode *end){
		if (head == NULL || head->next == NULL){
			return head;
		}
		else{
			ListNode *jump = head;
			ListNode *middle = head;
			while (jump != end&&jump->next != end){
				jump = jump->next->next;
				middle = middle->next;
			}
			middle = middle->next;
			ListNode *leftHalf = mergeSort(head, middle);
			ListNode *rightHalf = mergeSort(middle, NULL);
			return merge(leftHalf, rightHalf);
		}
	}
	ListNode *sortList(ListNode *head){
		if (head == NULL || head->next == NULL){
			return head;
		}
		else{
			return mergeSort(head, NULL);
		}
	}
};

